    const { selectedConversation } = useConversations() 
    alert(selectedConversation)
    return (
        <div className='d-flex' style={{ height : '100vh' }} >
            <Sidebar id={ id } />
            { selectedConversation && <OpenConversation /> }
            <script>alert(1)</script>
        </div>
        
    )
}
